import React from 'react';
import '../index.css';

function HomePage() {
  return (
    <div className="HomePage-main">
      <h1>Hello</h1>
      <img src={require('../images/pp.jpg')} alt="profile pic" />
    </div>
  );
}

export default HomePage;
